import React, { Component } from 'react';
import { MyContext } from '../../context';
import { Button } from 'antd';

export default class Profile extends Component {
  state = {
    user: {}
  }

  logOut = () => {
    this.props.history.push('/login')
    this.context.logOut()
  }

  render() {
    if (!this.context.state.loggedUser) return <p>Loading data...</p>
    const { name, email, gender, phone, image } = this.state.context.loggedUser
    return (
      <div>
        <img src={image} alt="Profile Image" />
        <h1>{name}</h1>
        <p>{email}</p>
        <p>{gender}</p>
        <p>{phone}</p>
        <Button htmlType="submit" onClick={this.logOut}>Log out</Button>
      </div>
    );
  }
}

Profile.contextType = MyContext;
